function Navbar() {
  return (
    <header>
       <nav class="navbar">
      <div class="container">
        <a href="#">Hulk</a>
        
        <a href="#" class="logo is-active">Mavel</a>
        <a href="#">Venom</a>
      </div>
    </nav>
      
      <style jsx>{`
        .nav-bar {
          background-color: black;
          height: 60px;
          color: white;
        }
        .box {
          background-color: blue;
          position: absolute;
          margin-top: 100px;
          margin-left: 50px;
        }
      `}</style>
    </header>
  );
}
export default Navbar;
